import React from 'react';
import imagemBK from './ShipLandingBK.png'

const ImagemBKGround = () => {
  return(
    <div className='ImagemBkGround'>
      <img src={imagemBK}/>
      <div className='content'>
        <h1>Real-time updates for</h1>
        <p>Port management.</p>
      </div>
    </div>
  )
}

export default ImagemBKGround
